
<!DOCTYPE html>
<html>

<head>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width,initial-scale=1" />
  <meta name="theme-color" content="#ffffff" />
  <title>Feder</title>
</head>

<body style="background: #000">
  <div id="feder-container-8842085" />
</body>

<script type="module">


import { Feder } from "https://unpkg.com/@zilliz/feder"
// console.log(Feder)

const mediaUrls = []
const mediaCallback = (rowId) => rowId in mediaUrls ? mediaUrls[rowId] : null

const feder = new Feder({
    filePath: "hnswSource",
    source: "hnswlib",
    domSelector: "#feder-container-8842085",
    viewParams: {
        ...{},
        mediaCallback,
    }
})
        
feder.overview()
        
</script>

</html>
